MarkdownBlockBase.code_block:
$clusterName = "[HDInsightClusterName]" $location = "[AzureDataCenter]" #i.e. West US $dataNodes = 32 # number of worker nodes in the cluster
$defaultStorageAccountName = "[DefaultStorageAccountName]" $defaultStorageContainerName = "[DefaultBlobContainerName]" $defaultStorageAccountKey = $defaultStorageAccountKey = Get-AzureStorageKey $defaultStorageAccountName.ToLower() | %{ $_.Primary }
$hdiUserName = "[HTTPUserName]" $hdiPassword = "[HTTPUserPassword]"
$hdiSecurePassword = ConvertTo-SecureString $hdiPassword -AsPlainText -Force $hdiCredential = New-Object System.Management.Automation.PSCredential($hdiUserName, $hdiSecurePassword)
$hiveConfig = new-object 'Microsoft.WindowsAzure.Management.HDInsight.Cmdlet.DataObjects.AzureHDInsightHiveConfiguration' $hiveConfig.Configuration = @{ "hive.execution.engine"="tez" }
New-AzureHDInsightClusterConfig -ClusterSizeInNodes $dataNodes -HeadNodeVMSize Standard_D14 -DataNodeVMSize Standard_D14 | Set-AzureHDInsightDefaultStorage -StorageAccountName "$defaultStorageAccountName.blob.core.windows.net" -StorageAccountKey $defaultStorageAccountKey -StorageContainerName $defaultStorageContainerName | Add-AzureHDInsightConfigValues -Hive $hiveConfig | New-AzureHDInsightCluster -Name $clusterName -Location $location -Credential $hdiCredential

